const serviceData = [
  {
    id: 1,
    title: "Rendre la voiture dans un autre point de location de l’agence",
    icon: "ri-map-pin-2-line",
    desc: "Lorsque vous faites un long voyage, et vous vous éloignez assez du point de location il est préférable de rendre la voiture louée dans un service de l’agence au point d’arriver. Une agence de location de voiture peut vous proposer une telle option. Cette option de location peut être facturée ou non.",
  },



  {
    id: 3,
    title: "Les conducteurs supplémentaires",
    icon: "ri-roadster-line",
    desc: "Il est possible que vous ne désiriez pas conduire la voiture louée, ou préfériez avoir un conducteur en cas de problème. La plupart des agences de location de véhicule proposent de fournir des chauffeurs compétents, moyennant un supplément.",
  },

  {
    id: 4,
    title: "Les sièges pour enfant",
    icon: "ri-timer-flash-line",
    desc: "Souvent, il est recommandé aux conducteurs d’installer les enfants d’un certain âge dans des sièges qui leur sont adaptés.",
  },


];

